import React from 'react';
import { useDispatch } from 'react-redux';
import { login } from '../features/user';

const Login = () => {
	const dispatch = useDispatch();
	return (
		<div>
			<button
				onClick={() => {
					dispatch(
						login({ name: 'matt', age: 33, email: 'whodat@whodat.com' })
					);
				}}>
				Login
			</button>
		</div>
	);
};

export default Login;
